import React from 'react'
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import TrackVisibility from 'react-on-screen';
import 'animate.css';
import img1 from '../img/ps1.jpeg'
import img2 from '../img/ps2.jpeg'
import img3 from '../img/ps3.jpeg'
import img4 from '../img/ps4.jpeg'
import img5 from '../img/ps5.jpeg'
import img6 from '../img/ps6.jpeg'
import img7 from '../img/ps7.jpeg'


export default function ShowHeat() {
    const responsive = {
        superLargeDesktop: {
          breakpoint: { max: 4000, min: 2000 },
          items: 3
        },
        largeDesktop: {
          breakpoint: { max: 2000, min: 1300 },
          items: 3
        },
        desktop: {
            breakpoint: { max: 1700, min: 1024 },
            items: 2
        },
        tablet: {
          breakpoint: { max: 1024, min: 464 },
          items: 1
        },
        mobile: {
          breakpoint: { max: 464, min: 0 },
          items: 1
        }
    };

    return (
        <div className='showHeat' id='pop'>
            <Carousel responsive={responsive} infinite={true} className="heat_slider">
                <div className='heat_img'>
                    <img src={img1}></img>
                    <h1>Parkside Roll</h1>
                </div>
                <div className='heat_img'>
                    <img src={img2}></img>
                    <h1>Japa Fries</h1>
                </div>
                <div className='heat_img'>
                    <img src={img3}></img>
                    <h1>Sashimi</h1>
                </div>
                <div className='heat_img'>
                    <img src={img4}></img>
                    <h1>Shrimp Tempura</h1>
                </div>
                <div className='heat_img'>
                    <img src={img5}></img>
                    <h1>Parkside Coffee</h1>
                </div>
                <div className='heat_img'>
                    <img src={img6}></img>
                    <h1>Parkside</h1>
                </div>
                <div className='heat_img'>
                    <img src={img7}></img>
                    <h1>Delux Tray</h1>
                </div>
            </Carousel>
        </div>
    )
}
